import React from 'react';
import { Link } from 'react-router-dom';
import PropTypes from 'prop-types'

const Nav = props => {
  return (
    <nav className='list-none'>
        
        
        <li>Mes activités</li>
        <li>Contactez-moi !</li>
    </nav>
  )
}

Nav.propTypes = {}

export default Nav;
